	function rgb2hex(rgbcolor){
		if(rgbcolor == "rgb(122, 122, 255)"){
			return "#7a7aff";
		}if(rgbcolor == "rgb(251, 56, 56)"){
			return "#fb3838";
		}if(rgbcolor == "rgb(158, 151, 142)"){
			return "#9e978e";
		}

	}



